import React from "react";
import "./Sidebar.css";

const categories = [
  "Electronics",
  "Men's Fashion",
  "Women's Fashion",
  "Home & Kitchen",
  "Toys & Baby",
  "Sports & Fitness",
  "Books & More",
];

const Sidebar = () => {
  return (
    <div className="sidebar">
      {categories.map((cat, index) => (
        <div key={index} className="category-item">
          {cat}
        </div>
      ))}
    </div>
  );
};

export default Sidebar;
